package string.RemoveAllAdjacentDuplicatesInString

import org.junit.Assert
import org.junit.Test
import string.RemoveAllAdjacentDuplicatesInString.RemoveAllAdjacentDuplicatesInString.removeDuplicates

class RemoveAllAdjacentDuplicatesInStringTest {
    @Test
    fun test() {
        Assert.assertEquals( removeDuplicates( "abbaca" ) , "ca" )
        Assert.assertEquals( removeDuplicates( "azxxzy" ) , "ay" )
        Assert.assertEquals( removeDuplicates( "" ) , "" )
    }
}